I have a Tooltip component that I want to use in different parts of my NextJS application. The problem is that I want to be able to close the previously opened Tooltip when a new one is opened.

## Solution

To solve this problem, I will use React Context to create a global state for the Tooltip component. This will allow me to keep track of the currently open Tooltip and close it when a new one is opened.

First, let's create a new file called `TooltipContext.js`:

```jsx
import React, { createContext, useState } from 'react';

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [openTooltip, setOpenTooltip] = useState(null);

  const closeTooltip = () => {
    setOpenTooltip(null);
  };

  const openTooltipHandler = (id) => {
    if (openTooltip === id) {
      closeTooltip();
    } else {
      setOpenTooltip(id);
      closeTooltip();
    }
  };

  return (
    <TooltipContext.Provider value={{ openTooltipHandler, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```

In this file, we create a new context called `TooltipContext` and a provider component called `TooltipProvider`. The provider component takes in children and sets up the state for the Tooltip component. We have a state variable called `openTooltip` which keeps track of the currently open Tooltip. We also have two functions: `closeTooltip` and `openTooltipHandler`.

The `closeTooltip` function sets the `openTooltip` state variable to `null`, which closes the currently open Tooltip.

The `openTooltipHandler` function takes in an `id` parameter, which is used to identify the Tooltip component. If the `openTooltip` state variable is equal to the `id` parameter, we call the `closeTooltip` function to close the currently open Tooltip. If the `openTooltip` state variable is not equal to the `id` parameter, we set the `openTooltip` state variable to the `id` parameter and call the `closeTooltip` function to close any previously open Tooltip.

Now, let's create the Tooltip component itself. Create a new file called `Tooltip.js`:

```jsx
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ id, children, content }) => {
  const { openTooltipHandler, closeTooltip } = useContext(TooltipContext);

  return (
    <div
      className="relative"
      onMouseEnter={() => openTooltipHandler(id)}
      onMouseLeave={closeTooltip}
    >
      {children}
      {openTooltip === id && (
        <div className="absolute z-10 bg-white text-black py-2 px-4 rounded shadow-lg">
          {content}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

In this file, we import the `TooltipContext` and use the `useContext` hook to access the `openTooltipHandler` and `closeTooltip` functions.

We wrap the Tooltip component in a `div` element with a `relative` position. We add an `onMouseEnter` event listener to the `div` element, which calls the `openTooltipHandler` function with the `id` parameter. We also add an `onMouseLeave` event listener to the `div` element, which calls the `closeTooltip` function.

We then check if the `openTooltip` state variable is equal to the `id` parameter. If it is, we render the Tooltip content inside a `div` element with an `absolute` position and some styling.

